import org.elasticsearch.spark._

import com.stratio.datasource._
import com.stratio.datasource.mongodb._
import com.stratio.datasource.mongodb.schema._
import com.stratio.datasource.mongodb.writer._
import com.stratio.datasource.mongodb.config._
import com.stratio.datasource.mongodb.config.MongodbConfig._
import com.stratio.datasource.util.Config._


//setup elastic search, index=>demo2, type=>logs
val logs = sqlContext.read.format("es").load("demo2/logs")
logs.registerTempTable("logs")

//setup mongo, database=>appmap, collection=>feedbacks
val builder = MongodbConfigBuilder(Map(Host -> List("localhost:27017"), Database -> "appmap", Collection ->"feedbacks", SamplingRatio -> 1.0))
val readConfig = builder.build()
val mongoRDD = sqlContext.fromMongoDB(readConfig)
mongoRDD.registerTempTable("feedbacks")

